/**
 * Page: TrainerDashboard.js
 * Purpose: Shows trainer's workshops and integrates create/edit forms
 * Location: /src/pages/TrainerDashboard.js
 */

import React, { useContext, useEffect, useState } from "react";
import { useNavigate, Routes, Route, useLocation } from "react-router-dom";
import {
  Box,
  Typography,
  Card,
  CardContent,
  CardActions,
  Button,
  Grid,
  CircularProgress,
} from "@mui/material";
import axios from "axios";
import DashboardLayout from "../components/DashboardLayout";
import { UserContext } from "../contexts/UserContext";
import CreateWorkshopForm from "./CreateWorkshopForm";
import EditWorkshopForm from "./EditWorkshopForm";

export default function TrainerDashboard() {
  const { currentUser } = useContext(UserContext);
  const navigate = useNavigate();
  const location = useLocation();

  const [workshops, setWorkshops] = useState([]);
  const [loading, setLoading] = useState(false);

  /** Fetch workshops from backend */
  const fetchWorkshops = async () => {
    setLoading(true);
    try {
      const response = await axios.get("http://127.0.0.1:8001/workshops/");
      // Filter only trainer's workshops (assuming trainer_id == 1 for now)
      setWorkshops(response.data.filter((w) => w.trainer_id === 1));
    } catch (err) {
      console.error("Failed to fetch workshops:", err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchWorkshops();
  }, []);

  const menuItems = [
    { label: "My Workshops", path: "/trainer/dashboard" },
    { label: "Create Workshop", path: "/trainer/workshops/create" },
  ];

  /** Handle success after create/edit */
  const handleSuccess = () => {
    fetchWorkshops();
    navigate("/trainer/dashboard");
  };

  return (
    <DashboardLayout menuItems={menuItems}>
      <Routes>
        <Route
          path="/dashboard"
          element={
            <Box>
              <Box
                sx={{
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                  mb: 3,
                }}
              >
                <Typography variant="h4" fontWeight="bold">
                  My Workshops
                </Typography>
                <Button
                  variant="contained"
                  color="primary"
                  onClick={() => navigate("/trainer/workshops/create")}
                >
                  + Create Workshop
                </Button>
              </Box>

              {loading ? (
                <CircularProgress />
              ) : workshops.length === 0 ? (
                <Typography variant="body1" color="text.secondary">
                  You have not created any workshops yet.
                </Typography>
              ) : (
                <Grid container spacing={3}>
                  {workshops.map((workshop) => (
                    <Grid item xs={12} sm={6} md={4} key={workshop.id}>
                      <Card elevation={3} sx={{ borderRadius: 2 }}>
                        <CardContent>
                          <Typography variant="h6" fontWeight="bold">
                            {workshop.title}
                          </Typography>
                          <Typography
                            variant="body2"
                            color="text.secondary"
                            sx={{ mb: 1 }}
                          >
                            Sections: {workshop.sections?.length || 0}
                          </Typography>
                        </CardContent>
                        <CardActions sx={{ justifyContent: "flex-end" }}>
                          <Button
                            size="small"
                            onClick={() =>
                              navigate(`/workshops/${workshop.id}`)
                            }
                          >
                            View
                          </Button>
                          <Button
                            size="small"
                            onClick={() =>
                              navigate(
                                `/trainer/workshops/edit/${workshop.id}`
                              )
                            }
                          >
                            Edit
                          </Button>
                        </CardActions>
                      </Card>
                    </Grid>
                  ))}
                </Grid>
              )}
            </Box>
          }
        />
        <Route
          path="/workshops/create"
          element={
            <CreateWorkshopForm
              onSuccess={handleSuccess}
              onCancel={() => navigate("/trainer/dashboard")}
            />
          }
        />
        <Route
          path="/workshops/edit/:id"
          element={
            <EditWorkshopForm
              onSuccess={handleSuccess}
              onCancel={() => navigate("/trainer/dashboard")}
            />
          }
        />
      </Routes>
    </DashboardLayout>
  );
}
